review":null,"owner":{"id":"16710760181","username":"calisthenicxelite"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/c9e13041a24dea5a83f1023061f1aee7/5D77A45A/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/e0b123db5c849c31508ea7fdc228605b/5D77DF5E/t51.2885-15/e15/p150x150/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":266},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/48f81c6815cf04d377b6271863be8cad/5D77E118/t51.2885-15/e15/p240x240/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":426},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/a74cd895aebe366eb57ff068f42b4111/5D77D9A6/t51.2885-15/e15/p320x320/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":568},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/9e6fc7672897b142da46793fbacec7e3/5D783BE1/t51.2885-15/e15/p480x480/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":480,"config_height":853},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/e193ea7a452771ce75fb7e0945069b05/5D77F3A3/t51.2885-15/sh0.08/e35/p640x640/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":640,"config_height":1137}],"is_video":true,"felix_profile_grid_crop":null,"encoding_status":"published","is_published":true,"product_type":"igtv","title":"DEDICATION - Calisthenics Motivation Pt. 4","video_duration":308.366,"video_view_count":643}},{"node":{"__typename":"GraphVideo","id":"2113621638921748710","edge_media_to_caption":{"edges":[{"node":{"text":"You\u2019ve been training for a while now and let me guess it feels like you hit some sort of wall. Is progress not going as fast as you\u2019d expect? Are you no longer feeling anything or any soreness after your workouts?\u2063\n\u2063\nDon\u2019t get me wrong these are not a bad thing. It only means that we\u2019ve gotten stronger but the feeling of plateauing is a very common problem that happens to the best of us. Usually this is a sign that we need to try something different.\u2063\n\u2063\nOne important factor we can try playing with are those \u201clast two reps.\u201d Those last few reps in every set really determine whether you\u2019ll see gains or not at a certain point. \u2063\n\u2063\nThe last few reps in every set are the most critical if you're really looking to get leaner, stronger and better. \u2063\n\u2063\nPushing out those reps at the end releases lipase, which is an enzyme that promotes fat breakdown and promote certain hormones to be released, like Testosterone and Growth Hormone that will aid in increasing lean body mass, fat burning and recovery. \u2063\n\u2063\nIn addition those last few reps really challenge the last of our muscle fibers. After all the other muscle fibers have fatigued, it takes tremendous neuromuscular activation to generate the force production necessary from those remaining muscle fibers which we many times forget to activate. This will stress them and cause them to grow as well.\u2063\n\u2063\nSo next time you hit a workout\u2026 don\u2019t be afraid to cut down on the sets but really focus on those last few reps and grind out two more even when it feels like you\u2019ve maxed out.\u2063\n\u2063\n#physicalconditioning #barsquad #barsteel #calisthenicsworldwide #streetworkoutmalaysia #muscledefinition #repsandsets #barworkout #thenx #barsparta #calisthenicsvideos #musclevideos #workout24 #fitnessvideos #calisthenicsworkout #bodyweight #calisthenics #workoutmotivation #nopainnogain #beastmode #frontlever #planche #dips #pullups #muscleup #calisthenicsmotivation #straddleplanche #planchetraining"}}]},"shortcode":"B1VF66hgoDm","edge_media_to_comment":{"count":1},"comments_disabled":false,"taken_at_timestamp":1566184472,"dimensions":{"height":1920,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/9168eca4e35630c248a6423928ce3c46/5D77C0DB/t51.2885-15/fr/e15/p1080x1080/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":154},"edge_media_preview_like":{"count":154},"location":null,"gating_info":null,"fact_check_information":null,"media_preview":null,"owner":{"id":"16710760181","username":"calisthenicxelite"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/1dcc657ca9031e45cd052ea99a40468b/5D780D6A/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/83eb0fb57be4805d9bdcff6c5bbb6c35/5D77D6EE/t51.2885-15/e15/p150x150/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":266},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/52c3415bfb73467162bf85630a2e5617/5D784168/t51.2885-15/e15/p240x240/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":426},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/693322bbaa0fffd3b64cbd3a9afaa56a/5D7844D6/t51.2885-15/e15/p320x320/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":568},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/f7b37527b62421aef0378633d5e46464/5D7847D1/t51.2885-15/e15/p480x480/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":480,"config_height":853},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/668368b4bb0b452dbae2f90acd189465/5D77B7D3/t ","config_width":640,"config_height":1137}],"is_video":true,"felix_profile_grid_crop":null,"encoding_status":"published","is_published":true,"product_type":"igtv","title":"WEEKEND WARRIORS - Calisthenics Motivation Pt. 2","video_duration":354.052,"video_view_count":313}},{"node":{"__typename":"GraphVideo","id":"2104265916442239818","edge_media_to_caption":{"edges":[{"node":{"text":"Happy Monday everyone. I know when I got started in calisthenics, it was the insane dynamic and static skills that got me hooked. I saw that and thought \"man I wish I could do that some day.\" I hope this compilation can spark the same fire in you that it did in me and gives you that extra motivation to have an amazing week of pushing your boundaries and get another week closer to your goals of muscle ups, handstands, front lever, planche, or whatever it maybe. \nI personally am working on front levers and handstand push ups right now and still have ways to go and much to learn. Let me know down below how long you've been at calisthenics and what you're working towards right now. \nIf you're also working on front lever and handstand push ups DM me and we should share our experiences \ud83d\ude4f"}}]},"shortcode":"B0z2rO-gGNK","edge_media_to_comment":{"count":6},"comments_disabled":false,"taken_at_timestamp":1565068474,"dimensions":{"height":1920,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/1fa0f354ca01118ced17243f10e40267/5D781236/t51.2885-15/fr/e15/p1080x1080/66357648_416129789110287_116863877913853094_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":189},"edge_media_preview_like":{"count":189},"location":null,"gating_info":null,"fact_check_information":null,"media_preview":null,"owner":{"id":"16710760181","username":"calisthenicxelite"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/0a99fa6688ca3d0bb24dceb04e4df8d9/5D77CDC1/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/66357648_416129789110287_116863877913853094_n.jpg 2B/t51.2885-15/fr/e15/p1080x1080/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":189},"edge_media_preview_like":{"count":189},"location":null,"gating_info":null,"fact_check_information":null,"media_preview":null,"owner":{"id":"16710760181","username":"calisthenicxelite"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/c9e13041a24dea5a83f1023061f1aee7/5D77A45A/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/e0b123db5c849c31508ea7fdc228605b/5D77DF5E/t51.2885-15/e15/p150x150/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":266},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/48f81c6815cf04d377b6271863be8cad/5D77E118/t51.2885-15/e15/p240x240/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":426},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/a74cd895aebe366eb57ff068f42b4111/5D77D9A6/t51.2885-15/e15/p320x320/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":568},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/9e6fc7672897b142da46793fbacec7e3/5D783BE1/t51.2885-15/e15/p480x480/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":480,"config_height":853},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/e193ea7a452771ce75fb7e0945069b05/5D77F3A3/t51.2885-15/sh0.08/e35/p640x640/68978049_2344130529238642_1066791254836375139_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":640,"config_height":1137}],"is_video":true,"felix_profile_grid_crop":null,"encoding_status":"published","is_published":true,"product_type":"igtv","title":"DEDICATION - Calisthenics Motivation Pt. 4","video_duration":308.366,"video_view_count":643}},{"node":{"__typename":"GraphVideo","id":"2113621638921748710","edge_media_to_caption":{"edges":[{"node":{"text":"You\u2019ve been training for a while now and let me guess it feels like you hit some sort of wall. Is progress not going as fast as you\u2019d expect? Are you no longer feeling anything or any soreness after your workouts?\u2063\n\u2063\nDon\u2019t get me wrong these are not a bad thing. It only means that we\u2019ve gotten stronger but the feeling of plateauing is a very common problem that happens to the best of us. Usually this is a sign that we need to try something different.\u2063\n\u2063\nOne important factor we can try playing with are those \u201clast two reps.\u201d Those last few reps in every set really determine whether you\u2019ll see gains or not at a certain point. \u2063\n\u2063\nThe last few reps in every set are the most critical if you're really looking to get leaner, stronger and better. \u2063\n\u2063\nPushing out those reps at the end releases lipase, which is an enzyme that promotes fat breakdown and promote certain hormones to be released, like Testosterone and Growth Hormone that will aid in increasing lean body mass, fat burning and recovery. \u2063\n\u2063\nIn addition those last few reps really challenge the last of our muscle fibers. After all the other muscle fibers have fatigued, it takes tremendous neuromuscular activation to generate the force production necessary from those remaining muscle fibers which we many times forget to activate. This will stress them and cause them to grow as well.\u2063\n\u2063\nSo next time you hit a workout\u2026 don\u2019t be afraid to cut down on the sets but really focus on those last few reps and grind out two more even when it feels like you\u2019ve maxed out.\u2063\n\u2063\n#physicalconditioning #barsquad #barsteel #calisthenicsworldwide #streetworkoutmalaysia #muscledefinition #repsandsets #barworkout #thenx #barsparta #calisthenicsvideos #musclevideos #workout24 #fitnessvideos #calisthenicsworkout #bodyweight #calisthenics #workoutmotivation #nopainnogain #beastmode #frontlever #planche #dips #pullups #muscleup #calisthenicsmotivation #straddleplanche #planchetraining"}}]},"shortcode":"B1VF66hgoDm","edge_media_to_comment":{"count":1},"comments_disabled":false,"taken_at_timestamp":1566184472,"dimensions":{"height":1920,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/9168eca4e35630c248a6423928ce3c46/5D77C0DB/t51.2885-15/fr/e15/p1080x1080/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":154},"edge_media_preview_like":{"count":154},"location":null,"gating_info":null,"fact_check_information":null,"media_preview":null,"owner":{"id":"16710760181","username":"calisthenicxelite"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/1dcc657ca9031e45cd052ea99a40468b/5D780D6A/t51.2885-15/sh0.08/e35/c0.420.1080.1080a/s640x640/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/83eb0fb57be4805d9bdcff6c5bbb6c35/5D77D6EE/t51.2885-15/e15/p150x150/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":266},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/52c3415bfb73467162bf85630a2e5617/5D784168/t51.2885-15/e15/p240x240/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":426},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/693322bbaa0fffd3b64cbd3a9afaa56a/5D7844D6/t51.2885-15/e15/p320x320/66918672_2498681300352043_5039987202770215898_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":568},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/f7b37527b62421aef0378633d5
